import React from 'react';
import styled from 'styled-components';
import { motion } from "framer-motion";

const StyledSlideOne = styled.div`
  position: relative;
  background: #FFFFFF;
  height: 100vh;
  width: 100vw;

  .cars-group {
    position: absolute;
    bottom: 0;

    #silver-car {
      height: 21vh;
      position: absolute;
      bottom: 100px;
      left: 61px;
    }
    #white-car-1 {
      height: 30vh;
      transform: scaleX(-1);
      position: absolute;
      bottom: 91px;
      left: -139px;
    }
    #white-car-2 {
      height: 21vh;
      position: absolute;
      bottom: 115px;
      left: 240px;
    }
  }
  .image-wrapper {
    position: absolute;
    top: 40px;
    right: 80px;
    display: inline-block;
    height: 80vh;

    img {
      height: 100%;
      border: black solid 3px;
      border-radius: 30px;
      box-shadow: -12px 13px 27px -8px rgba(0,0,0,0.77);
    }
  }
  .background-top {
    position: relative;
    background: #FAC943;
    width: 100%;
    height: 80vh;
  }
`;

function SlideOne() {
  const backgroundTopAnimation = {

  };

  return (
    <StyledSlideOne>
      <motion.div
        initial={{ x : "-100vw" }}
        animate={{ x: "0vw" }}
        transition={{ duration: 0.8 }}
        className='background-top'
      />
      <motion.div 
        className='cars-group'
      >
        <img id='white-car-1' src='images/white_car_left.png' alt='white sports car' />
        <img id='white-car-2' src='images/white_car_right.png' alt='white sports car' />
        <img id='silver-car' src='images/silver_car.png' alt='silver sports car' />
      </motion.div>
      <div className='image-wrapper'>
        <img src='images/app_screen_4.png' alt='mobile device with Eleanor app'/>
      </div>
    </StyledSlideOne>
  );
}

export default SlideOne;
